import React, { useState } from 'react';
import './Header.css';
import ModalCmp from '../ModalCmp/ModalCmp';

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';


import logo from '../../assets/logo.svg';

export default function Header(props){

  return(
      <React.Fragment>
        {/* NavBar Code*/}
        <AppBar position="static" id='app-bar-style'>
                <Toolbar>
                    <img src={logo} className='brand-icon-style rotate-image'/>
                    <Button variant="contained" color="primary" className='book-show-btn-style'>Book Show</Button>
                    <Button variant="contained" color="default" className='login-logout-btn-style' onClick={ModalCmp}>
                        Login
                    </Button>
                </Toolbar>
        </AppBar>
        </React.Fragment>

  );
}
